import React from "react";
import profile_pic from '../images/profile_pic.png';




const Card = () => {
    return(
        <div className="ba Card_container flex flex-column items-center">
            <img className="ba Card_picture" id="project_1" alt="Project1" 
                 title=" Project1" src={profile_pic}></img> 
            <h1 className="ba"> Hello World</h1>
            <h3 className="ba pb3"> hello world</h3>
        </div>
    )
}


export default Card;
